import React from 'react';

import { NavLink } from "react-router-dom";

function Header() {
  return (
    <div className="header">
      <img />
      <nav>
        <NavLink to="/"> Primo </NavLink>
        <NavLink to="/"> Primo </NavLink>
        <NavLink to="/"> Primo </NavLink>
      </nav>
    </div>
  )
}

export default Header
